import {Link} from 'react-router-dom'

function Navbar(){
    return(
        <div className="navbar">
            <Link to="/">Home</Link>
            <Link to="">View All Articles</Link>
            <Link to="">Search Article</Link>
            <Link to="">Create New Article</Link>

        </div>
    )
}
export default Navbar;
